            //         $exists: 0
            //     }
            // }).fetch();

            // Meteor.defer(function() {
            //     payments.forEach(function(payment) {
            //         if (payment.transaction.statusTransacao) {
            //             Payments.update({
            //                 _id: payment._id
            //             }, {
